ぜい沢マスクシリーズの子供サイズ。<br><br>・風邪、インフルエンザ対策にはもちろん、通学時や給食当番でもお使いいただけます<br>・ノーズフィッターが入っていない安全設計タイプ<br>・清潔でもち運びに便利な個別包装<br>・口元部分にふんわり柔らか不織布使用で快適な着け心地<br>・特殊なサイドラインですっきっりフェイスライン<br>・99%カットフィルタで花粉・細菌・飛沫・ウイルス・PM2.5等の侵入をガード(米国ネルソン研究所試験)<br>・マスク本体サイズ:約8.5×13.5(子供サイズ)<br><br><br><br>広告文責：アットライフ株式会社<br>TEL 079-280-2113<br>※商品パッケージは変更の場合あり。<br>メーカー欠品または完売の際、キャンセルをお願いすることがあります。ご了承ください。<br><style type="text/css">
